// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

import "@openzeppelin/contracts/token/ERC1155/utils/ERC1155Receiver.sol";
import "@openzeppelin/contracts/utils/introspection/ERC165.sol";
import "@openzeppelin/contracts/token/ERC1155/IERC1155.sol";
import "@openzeppelin/contracts/token/ERC1155/extensions/IERC1155MetadataURI.sol";

contract AbstractERC1155Receiver is ERC1155Receiver {
    bytes4 constant onErc1155SuccessfulResult =
        bytes4(
            keccak256(
                "onERC1155Received(address,address,uint256,uint256,bytes)"
            )
        );

    event DepositedERC1155(
        address operator,
        address from,
        address tokenAddress,
        uint256 tokenId,
        uint256 amount,
        bytes data
    );

    event BatchDepositedERC1155(
        address operator,
        address from,
        address tokenAddress,
        uint256[] ids,
        uint256[] values,
        bytes data
    );

    /**
     * @dev See {IERC165-supportsInterface}.
     */
    function supportsInterface(bytes4 interfaceId)
        public
        view
        virtual
        override(ERC1155Receiver)
        returns (bool)
    {
        return
            interfaceId == type(IERC1155Receiver).interfaceId ||
            super.supportsInterface(interfaceId);
    }

    function onERC1155Received(
        address operator,
        address from,
        uint256 tokenId,
        uint256 amountTokens,
        bytes calldata data
    ) external override returns (bytes4) {
        emit DepositedERC1155(
            operator,
            from,
            msg.sender,
            tokenId,
            amountTokens,
            data
        );
        return onErc1155SuccessfulResult;
    }

    function onERC1155BatchReceived(
        address operator,
        address from,
        uint256[] calldata ids,
        uint256[] calldata values,
        bytes calldata data
    ) external override returns (bytes4) {
        emit BatchDepositedERC1155(
            operator,
            from,
            msg.sender,
            ids,
            values,
            data
        );
        return onErc1155SuccessfulResult;
    }
}
